import React, { useState, useEffect } from "react";
import "./App.css";
// import Routes from "./Routes";
import axios from "axios";
import Home from "./screens/Home";
import OrderRest from "./components/OrderRest";

const App = () => {
  const [test, setTest] = useState([]);

  useEffect(async () => {
    const response = await axios("http://127.0.0.1:8000/api/restaurant/");

    setTest(response.data.results);
  }, []);
  return (
    <div>
      {/* <Routes /> */}
      {test.map((restaurant) => (
        <OrderRest name={restaurant.name} />
      ))}
    </div>
  );
};

export default App;
